def max_chain_length(s):
    n = len(s)
    max_len = 0
    for i in range(n):
        for j in range(i + 1, n):
            for k in range(j + 1, n):
                eab = s[i:j+1]
                if eab.count('E') == 3 and eab.count('A') + eab.count('B') + eab.count('C') == 2:
                    chain = s[:i] + eab + s[j+1:]
                    if len(chain) > max_len:
                        max_len = len(chain)
    return max_len

