    r = ''
    for i in range(len(s)):
        r = s[i] + r
    return r

def bc_to_dec(n):
    s = str(n)
    r = ''
    for i in range(len(s)):
        if s[i] == '0':
            r += '0'
        else:
            r += '1'
    return int(r)

