def calc_mass(s):
    mass = 0
    i = 0
    while i < len(s):
        if s[i].isdigit():
            j = i
            while j < len(s) and s[j].isdigit():
                j += 1
            num = int(s[i:j])
            if s[i-1] == 'n':
                mass += num * 14
            elif s[i-1] == 'c':
                mass += num * 12
            elif s[i-1] == 'h':
                mass += num * 1
            i = j
        else:
            i += 1
    return mass

